  import { Component, OnInit } from '@angular/core';
  import { PaellasService } from 'src/app/services/paellas.service';
  import { Paella } from '../../Interfaces/paella';
  import { Injectable } from '@angular/core';
  import * as moment from 'moment-timezone';
  import { Router } from '@angular/router';
  import {FormGroup, FormControl, Validators} from '@angular/forms';
import { ReadVarExpr } from '@angular/compiler';


  @Component({
    selector: 'app-publica-paella',
    templateUrl: './publica-paella.component.html',
    styleUrls: ['./publica-paella.component.css']
  })
  export class PublicaPaellaComponent implements OnInit {

    img;
    user = localStorage.getItem('userData');
    userData = JSON.parse(this.user);
    imageSrc;

    paella: Paella = {

      nombre: null,
      descripcion: null,
      cocinero: this.userData.name,
      foto: null,
      ubicacion: null,
      provincia: null,
      plazas: null,
      plazas_libres: null,
      precio: null,
      telefono: null,
      fecha: null,
      ver_hacer_paella: null,
      ninos: null,
      mascota: null,
      categoria: null,
      usuario_id: this.userData.id,

    }

    constructor(private paellaService: PaellasService, private router: Router) { }

    ngOnInit(): void {
    }

handleUpload(event) {                                   //esto coge la foto del input y la convierte a formato base 64
    const file = event.target.files[0];
   
    const reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = () => {
        console.log(reader.result);
        this.img = reader.result;
        alert('¡Imagen recibida correctamente!')
    
    
    this.imageSrc = this.img;           //metemos la foto en b64 en imageSrc y la decodifica con atob, que literalmente solo sirve para decodifcar b64 y mostramos imageSrc en el html
    this.imageSrc = atob(this.imageSrc);

    };
}


    savePaella() {


      this.paella.foto = this.img;

      if(this.paella.categoria== null){
        this.paella.categoria=0;
              }
      if(this.paella.ninos== null){
        this.paella.ninos=false;
              }
      if(this.paella.ver_hacer_paella== null){
        this.paella.ver_hacer_paella=false;
              }
              if(this.paella.mascota== null){
                this.paella.mascota=false;
                      }
      //este if es por si no pusiera foto que salga una de default, está puesta en base 64 para no calentarse la cabeza, cierralo y no te rayes

      if(this.paella.foto==undefined){
        console.log('pero al if si entra eh')
        this.paella.foto="data:image/png;base64,"
       //Esto es básicamente que si no pones foto sale la foto esta en b64 de default  
       
      }


      //tratamos la hora porque el datepicker de angular saca la hora en formato ISO y eso no le gusta a la bbdd, asi que vamos a cambiar el formato, darle categoría y que la bbdd guarde la fecha como toca 


      const fechabbdd = moment.tz(this.paella.fecha, 'Europe/Madrid'); //decimos que de base tome que lo estas poniendo en madrid, esto habra que cambiarlo si gente internacional sube paellas

      //abajo la fecha la convertimos al formato de la bbdd que es el YYYY-MM-DD etc pero de base la fecha la devuelve en formato ISO, que como formato es mejor pero la bbdd no lo acepta tal y como está.

      this.paella.fecha = fechabbdd.tz(moment.tz.guess(true)).format('YYYY-MM-DD HH:mm:ss');  //guess es: ignora cache? : boolean.  el format es simplemente el formato en que queremos

      var user = localStorage.getItem('user');

      this.paellaService.save(this.paella).subscribe((data) => {    //Guardamos la paella
        alert('¡Paella guardada!');
        console.log(data);
         this.router.navigate(['/']); 
      }, (error) => {
        console.log("error en publica-paella.ts");
        alert('Por favor, revisa y rellena correctamente todos los campos');
        alert('Asegurate de ingresar la fecha con el simbolo de calendario')
      })
    }

  }
